import ReactDOM from "react-dom";
import header from "./components/Header.jsx";
import footer from "./components/Footer.jsx";
import note from "./components/Note.jsx";

function App(){
    return (<div>
    <header className="header"/>
    <note />
    <footer />
    </div>);
}

export default App;
